import Header from './../mainComp/Header';
import First from './../mainComp/First';
import AboutMe from '../mainComp/AboutMe';
import Skills from '../mainComp/Skills';

function Main() {
  return (
    <div className="main_container">
      <Header />
      <First />
      <AboutMe />
      <Skills />
    </div>
  );
}

export default Main;
